import React from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


import MastHead from "./MastHead";
import Home from "./Home";
import Fitness from "./Fitness";
import Sports from "./Sports";
import Events from "./Events"
import Lessons from "./Lessons";
import MJE from "./MJE";
import MCE from "./MCE";
import UpcomingCE from "./UpcomingCE";
import PastCE from "./PastCE";
import PastE from "./PastE";
import UpcomingE from "./UpcomingE";
import Feedback from "./Feedback";

import "./App.css";

const App = () => {
    return (
    <Router>
        <MastHead/>
        <Switch>
            <Route path="/fitness">
                <Fitness/>
            </Route>
            <Route path="/events">
                <Events/>
            </Route>
            <Route path="/lessons">
                <Lessons/>
            </Route>
            <Route path="/sports">
                <Sports/>
            </Route>
            <Route path="/download">
                <Download/>
            </Route>
            <Route path="/MJE">
                {console.log("inside")}
                <MJE/>
            </Route>
            <Route path="/UpcomingE">
                <UpcomingE/>
                </Route>
                <Route path="/PastE">
                    <PastE/>
                </Route>
                <Route path="/UpcomingCE">
                <UpcomingCE/>
            </Route>
            <Route path="/PastCE">
                <PastCE/>
            </Route>
            <Route path="/MCE">
                <MCE/>
            </Route>
            <Route path="/">
                <Home/>
            </Route>
            <Route path="/Feedback">
                <Feedback/>
            </Route>
        </Switch>
    </Router>)
};

export default App;
